import React from 'react'

function WeatherTile({ weatherData }) {

    const kelvinToCelsius = (kelvin) => {
        return Math.round((kelvin) - 273.15)
    };
    
    return (
        <div>
            <div class="flex justify-center items-center flex-col ">
                <div class="rounded-lg shadow-lg bg-slate-400 max-w-xl flex flex-col items-center p-4">
                    <img class="rounded-t-lg justify-center" src={`${process.env.REACT_APP_WEATHER_APP_ICON_URL}/${weatherData?.weather[0]?.icon}@2x.png`} alt="" />
                    <div class="p-6 flex flex-col justify-center items-center">
                        <h1 className="text-center text-4xl font-mono text-stone-200">{weatherData?.name}</h1>
                        <h2>Wind Speed : {weatherData?.wind?.speed}</h2>
                        <h3>Temp :{weatherData?.main?.temp}</h3>
                        <h3>{weatherData?.main?.feels_like}</h3>
                        <h3>{weatherData?.main?.pressure}</h3>
                        <h3>{weatherData?.main?.humidity}</h3>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default WeatherTile
